import React from "react";

export default function PertanyaanKuesioner() {
  return (
    <div>
      <div className="flex flex-row bg-gray-200 h-12 justify-between justify-items-center items-center">
        <div className="mr-2 ml-20 text-sm font-nunito text-black">
          Apakah tersusun rencana kerja kegiatan (waktu, target dan roadmap) ?
        </div>
        <div className="text-sm font-nunito text-black mr-12">30%</div>
      </div>
    </div>
  );
}
